import Layout from '../components/MyLayout';
import Link from 'next/link';
import fetch from 'isomorphic-unfetch';

const Mindbodyonline = (props) => (
	<Layout>
		<p>MBO API</p>
		<ul>
			{props.poses.map((pose) => (
				<li key={pose.id}>
					<Link href="/p/[id]" as={`/p/${pose.id}`}>
						<a>{pose.name}</a>
					</Link>
					<p>{pose.category}</p>
				</li>
			))}
		</ul>
	</Layout>
);

Mindbodyonline.getInitialProps = async function() {
	const res = await fetch('https://api.mindbodyonline.com/public/v6/class/classschedules?');
	const data = await res.json();
	console.log(`Class schedule data fetched. Count: ${data.length}`);

	return {
		// poses : data.map((entry) => entry.pose)
		schedule : data
	};
};

// Need to use method get

export default Mindbodyonline;
